import java.util.ArrayList;
import java.util.List;

class Solution {
    private int find(int[] parent, int i) {
        if (parent[i] != i) {
            parent[i] = find(parent, parent[i]);
        }
        return parent[i];
    }

    private void union(int[] parent, int x, int y) {
        int rootX = find(parent, x);
        int rootY = find(parent, y);
        if (rootX != rootY) {
            parent[rootY] = rootX;
        }
    }

    public boolean canTraverseAllPairs(int[] nums) {
        int n = nums.length;
        int[] parent = new int[n];
        for (int i = 0; i < n; i++) {
            parent[i] = i;
        }

        // Prime factors mapping to list of indices
        List<List<Integer>> primeFactorsIndices = new ArrayList<>(100001);
        for (int i = 0; i <= 100000; i++) {
            primeFactorsIndices.add(new ArrayList<>());
        }

        for (int i = 0; i < n; i++) {
            int num = nums[i];
            for (int factor = 2; factor * factor <= num; factor++) {
                if (num % factor == 0) {
                    primeFactorsIndices.get(factor).add(i);
                    while (num % factor == 0) {
                        num /= factor;
                    }
                }
            }
            if (num > 1) { // num itself is a prime number
                primeFactorsIndices.get(num).add(i);
            }
        }

        for (List<Integer> indices : primeFactorsIndices) {
            for (int i = 1; i < indices.size(); i++) {
                union(parent, indices.get(0), indices.get(i));
            }
        }

        int root = find(parent, 0);
        for (int i = 1; i < n; i++) {
            if (find(parent, i) != root) {
                return false;
            }
        }
        return true;
    }
}
